apiVersion: apps/v1
kind: DaemonSet
metadata:
  labels:
    app: up9-collector-daemonset
  name: up9-collector-daemonset
  namespace: up9
spec:
  revisionHistoryLimit: 10
  selector:
    matchLabels:
      app: up9-collector-daemonset
  template:
    metadata:
      labels:
        app: up9-collector-daemonset
    spec:
      automountServiceAccountToken: true
      containers:
        - env:
            - name: UP9_ENV_SUFFIX
              value: "up9.app"
            - name: PASSIVE_TAPPER_PORT
              value: "25111"
            - name: ENVOY_ADMIN_PORT
              value: "21213"
            - name: CLIENT_ID
              value: "__TMPL_CLIENT_ID__"
            - name: CLIENT_SECRET
              value: "__TMPL_CLIENT_SECRET__"
            - name: AGENT_NAME
              value: "__TMPL_AGENT_NAME__"
            - name: DEFAULT_MODEL
              value: "default"
            - name: UP9_DISABLE_LOGS_STDOUT
              value: "0"
            - name: UP9_DISABLE_LOGS_STDERR
              value: "0"
            - name: UP9_DISABLE_LOGS_CLOUD
              value: "0"
            - name: NODE_NAME
              valueFrom:
                fieldRef:
                  apiVersion: v1
                  fieldPath: spec.nodeName
          image: gcr.io/up9-docker-hub/collector/master:latest
          imagePullPolicy: Always
          name: up9-collector-daemonset
          resources: {}
          terminationMessagePath: /dev/termination-log
          terminationMessagePolicy: File
      dnsPolicy: ClusterFirst
      restartPolicy: Always
      schedulerName: default-scheduler
      securityContext: {}
      serviceAccount: up9-service-account
      serviceAccountName: up9-service-account
      shareProcessNamespace: false
      terminationGracePeriodSeconds: 30
  updateStrategy:
    rollingUpdate:
      maxUnavailable: 1
    type: RollingUpdate
