# Source: up9/templates/injector.yaml
apiVersion: apps/v1
kind: Deployment
metadata:
  name: "up9-sidecar-injector"
  namespace: up9
  labels:
    app: "up9-sidecar-injector"
spec:
  replicas: 1
  selector:
    matchLabels:
      app: "up9-sidecar-injector"
  strategy:
    type: RollingUpdate
    rollingUpdate:
      maxSurge: 1
      maxUnavailable: 0
  template:
    metadata:
      labels:
        app: "up9-sidecar-injector"
    spec:
      serviceAccountName: up9-service-account
      volumes:
      - name: secrets
        secret:
          secretName: up9-sidecar-injector
      containers:
      - name: "up9-sidecar-injector"
        imagePullPolicy: Always
        image: gcr.io/up9-docker-hub/sidecar-injector:v1
        command: ["entrypoint.sh"]
        args: []
        ports:
        - name: https
          containerPort: 9443
        - name: http-metrics
          containerPort: 9000
        volumeMounts:
        - name: secrets
          mountPath: /var/lib/secrets
        livenessProbe:
          httpGet:
            scheme: HTTPS
            path: /health
            port: https
          initialDelaySeconds: 10
          periodSeconds: 10
          timeoutSeconds: 3
        env:
        - name: "TLS_CERT_FILE"
          value: "/var/lib/secrets/sidecar-injector.crt"
        - name: "TLS_KEY_FILE"
          value: "/var/lib/secrets/sidecar-injector.key"
        - name: "LOG_LEVEL"
          value: "2"
        - name: "CONFIG_DIR"
          value: "conf/"
        - name: "CONFIGMAP_LABELS"
          value: "app=up9-sidecar-injector"
        - name: "ANNOTATION_NAMESPACE"
          value: injector.up9
